import React from "react";
import "./body_cart.css";
import { useState, useEffect } from "react";
import axios from "axios";

const Body_cart = () => {
  const [showApi, setShowApI] = useState([]);

  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/products")
      .then((res) => {
        setShowApI(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="data_container">
      <div  className="data_box">
        {showApi.map((showdata) => {
          return (
            <div className="data_div" key={showdata.id}>
             <div>{showdata.title}</div>
             <div> {showdata.price}</div>
             <div>{showdata.category}</div>
             <div><p> {showdata.description}</p></div>
             <div>{showdata.title}</div>
             <div>{showdata.title}</div>
             <div>{showdata.title}</div>
             
              
             
              {showdata.rate}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Body_cart;
